import React, { useEffect } from 'react'

import { Map, Marker, GoogleApiWrapper } from 'google-maps-react'

import './css/GoogleMap.scss'

const GoogleMap = (props) => {
    const mapStyles = [
        {
          stylers: [
            {
              hue: '#2c3e50',
            },
            {
              saturation: 250,
            },
          ],
        },
        {
          featureType: 'road',
          elementType: 'geometry',
          stylers: [
            {
              lightness: 50,
            },
            {
              visibility: 'simplified',
            },
          ],
        },
        {
          featureType: 'road',
          elementType: 'labels',
          stylers: [
            {
              visibility: 'off',
            },
          ],
        },
      ];

    const drawMarker = () => {
        const state = {
            cords: [
                {latitude: 51.54015818523244, longitude: 5.995251772262631}
            ]
        }

        return state.cords.map((store, i) => {
        return <Marker key={i} id={i} position={{
            lat: store.latitude,
            lng: store.longitude
        }}

        onClick={() => console.log("Event Hanlder Called")} />
        })
    }

    useEffect(() => {
        drawMarker()
    })

    return (
        <>
            <div
                id='map'
            >
                <Map
                    google={props.google}
                    /* style={customizeMap} */
                    zoom={15}
                    options={{style: mapStyles}}
                    initialCenter={{ 
                        lat: 51.54015818523244, 
                        lng: 5.995251772262631
                    }}>
                    {/* {drawMarker()} */}
                </Map>
            </div>
        </>
    )
}

export default GoogleApiWrapper({
    apiKey: 'AIzaSyCTBkMwf2XzdLg7Rzr3r8sG81Kfx86Yuu0'
  })(GoogleMap)
